style.css:
@-moz-document domain("google.jo") {
/* Add a creepy bunny image at the top of the page */
    body::before {
        content: "";
        background: url("https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/6100b008-eaff-432b-97fd-0d28a746e8ab/dezjqe2-0f75ebac-cb55-4597-a1ab-2bfbf287d1eb.png/v1/fit/w_828,h_828/_c4d_fnaf__springbonnie_v5_by_springreg_dezjqe2-414w-2x.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..SyXM26cpv3qrWagU0_5LFQtDkx5DdC05978YaCquuTw") no-repeat center top;
        background-size: 150px 150px;
        display: block;
        width: 150px;
        height: 150px;
        margin: 0 auto;
        position: absolute;
        top: 10px;
        left: 50%;
        transform: translateX(-50%);
        z-index: 9999;
    }

    /* Rest of the scary theme styles */
    body {
        background-color: #0b0b0b !important;
        color: #ff0000 !important;
        font-family: "Creepster", cursive !important;
    }

    #hplogo {
        filter: brightness(0.3) sepia(1) hue-rotate(180deg) !important;
        transform: rotate(-5deg) scale(1.1) !important;
    }

    input[type="text"] {
        background-color: #111 !important;
        color: #ff3333 !important;
        border: 2px solid #ff0000 !important;
        box-shadow: 0 0 15px #ff0000 !important;
    }

    input[type="submit"], button {
        background-color: #220000 !important;
        color: #ff0000 !important;
        border: 2px solid #ff0000 !important;
        box-shadow: 0 0 15px #ff0000 !important;
        animation: pulse 2s infinite alternate !important;
    }

    * {
        text-shadow: 2px 2px 5px #330000 !important;
    }

    a {
        color: #bb0000 !important;
        text-decoration: none !important;
    }

    @keyframes pulse {
        0% {
            box-shadow: 0 0 10px #ff0000;
        }
        100% {
            box-shadow: 0 0 20px #ff0000;
        }
    }
}
